// Controller object

const productsController = {
  index: async (req, res) => {
    try {
      const products = Products.find();

      res.render('Layouts/adminDashboard/products', {
        title: 'Products',
        products,
        categories: ['All', 'Men', 'Women', 'Kids'],
        types: ['All', 'Mechanical', 'Automatic', 'Quartz']
      });
    } catch (error) {
      console.error('Error fetching products:', error);
      res.status(500).render('error', { error: 'Failed to load products' });
    }
  },

  getFilteredProducts: async (req, res) => {
    try {
      const filteredProducts = Products.find();

      res.json({
        success: true,
        products: filteredProducts,
        count: filteredProducts.length
      });
    } catch (error) {
      console.error('Error filtering products:', error);
      res.status(500).json({
        success: false,
        message: 'Failed to filter products'
      });
    }
  },

  getProduct: async (req, res) => {
    try {
      const { id } = req.params;
      const product = sampleProducts.find(p => p.id === parseInt(id));

      if (!product) {
        return res.status(404).json({
          success: false,
          message: 'Product not found'
        });
      }

      res.json({ success: true, product });
    } catch (error) {
      console.error('Error fetching product:', error);
      res.status(500).json({
        success: false,
        message: 'Failed to fetch product'
      });
    }
  },

  deleteProduct: async (req, res) => {
    try {
      const { id } = req.params;
      const index = sampleProducts.findIndex(p => p.id === parseInt(id));

      if (index === -1) {
        return res.status(404).json({
          success: false,
          message: 'Product not found'
        });
      }

      sampleProducts.splice(index, 1);
      res.json({
        success: true,
        message: 'Product deleted successfully'
      });
    } catch (error) {
      console.error('Error deleting product:', error);
      res.status(500).json({
        success: false,
        message: 'Failed to delete product'
      });
    }
  }
};

// ESM export
export default productsController;
